import './PostArticle.css';
import React from 'react';
import {Title}  from './components/ArticleStyle.js';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import {useState} from "react";

const PostArticle=()=> {


    function ArticleFoodInput({ author, text }) {
        return (
          <form className='articleFoodForm'>
            <label>標題:</label>
            <input type='text'></input><br/>
            <label>營業時間:</label>
            <input type='text'></input><br/>
            <label>店家地址:</label>
            <input type='text'></input><br/>
            <label>店家資訊:</label>
            <input type='text'></input><br/>
            <label>google評分:</label>
            <input type='text'></input><br/>
            <label>校內評分:</label>
            <input type='text'></input><br/>
          </form>  
        );
      }

      function ArticleRentInput({ author, text }) {
        return (
          <form className='articleRentForm'>
            <label>標題:</label>
            <input type='text'></input><br/>
            <label>內文:</label>
            <input type='text'></input><br/>
            <label>租金:</label>
            <input type='text'></input>
            <label>性別:</label>
            <input type='text'></input><br/>
            <label>人數:</label>
            <input type='text'></input>
            <label>房型:</label>
            <input type='text'></input><br/>
            <label>地區:</label>
            <input type='text'></input>
            <label>車位:</label>
            <input type='text'></input><br/>
            <label>水費:</label>
            <input type='text'></input>
            <label>電費:</label>
            <input type='text'></input><br/>
            <label>地址:</label>
            <input type='text'></input><br/>
          </form>  
        );
      }

      function ArticleChangeClassInput({ author, text }) {
        return (
          <form className='articleChangeClassForm'>
            <label>標題:</label>
            <input type='text'></input><br/>
            <label>內文:</label>
            <input type='text'></input><br/>
          </form>  
        );
      }

    function PostArticle() {
      /*const [nickName_id, setNickName_id] = useState("");
      const handleChange = event => {
        setNickName_id(event.target.nickName_id);
      };
      const handleSubmit = (event) => {
        event.preventDefault();
        alert(`The nickName you entered was: ${nickName_id}`)
      }*/

      const [isShown, setIsShown] = useState(false);

      const handleClick = event => {
        setIsShown(true);
      };

      

      return (
        <div className="PostArticle">    
            <div className='PostArticle_bg'>
                <Title>發文</Title>
                <div className='articleFormPosition'>
                    <div className='articleForm'>
                        <select className='selectType'>
                            <option value="food" onClick={()=>this.clickHandler('food')}>美食版</option>
                            <option value="rent" onClick={()=>this.clickHandler('rent')}>租屋版</option>
                            <option value="changeClass"onClick={()=>this.clickHandler('changeClass')}>換課版</option>
                        </select>
                    </div>
                </div>

            </div>
        </div>
      );
    }

    return (
           
                <Routes>
                    <Route path="/" element={<PostArticle />} />
                </Routes>
             
    );
}

export default PostArticle;
